import React from "react";

function Header() {
  return (
    <header>
      <nav class="container desktop-menu" />
      <ul class="horizontal-list">
        <li data-aos="fade-down" data-aos-duration="400" class="">
          <a href="#landing-section">Home</a>
        </li>
      </ul>
    </header>
  );
}

export default Header;
